webpackJsonp([0xac9d2f9de91b],{4235:function(a,t){a.exports={data:{markdownRemark:{html:'<p><a href="http://kagaminer.in/">次回作</a>はちょっと要求スペックが高くなりますので、買ったけど動かんかった！ってことにならないよう判定プログラムを作ってみましたので<del>公開いたします</del>。実際に起動してみて、下記の2点が問題なければ(多分)大丈夫です。</p>\n<ul>\n<li>このプログラムが正常に起動し、正常に判定を終了すること</li>\n<li>判定結果の表示が良好なこと\nちなみにまくPCで実験したところ、3台中<a href="/palx190dr">1台</a>は良好、<a href="/netvista-m42slim">もう1台</a>は起動はしたものの、判定結果がNGでした。 (ちなみに<a href="/homebuilt-2">残りの1台</a>はLinux機なのでそもそも起動せず) そんなわけで皆様も是非試してみてくださいな。 /* さて……夏コミまでにどこまで作れるか……。画面は作りたいが、間に合うかどうかびもうなところではある \'Ａ｀ */ <a href="/!/thC/">夢終劇.NET プレ アルファ版</a>が事実上の後継として機能しているため、判定プログラムの公開は終了しました。</li>\n</ul>',frontmatter:{cover:null,date:"2008-07-29T00:00:00+09:00",strDate:"2008/7/28",title:"thM(仮称)動作スペック判定プログラム"}}},pathContext:{path:"/ja/blog/2008/07/29-thm仮称動作スペック判定プログラム/",langKey:"ja"}}}});
